import React from 'react';

function LoginForm({ visible, setVisible, onShowRegister }) {
  const closeForm = () => {
    setVisible(false);
  };

  return (
    <div className={`login-form-container${visible ? ' active' : ''}`}>
      <div id="close-login-btn" className="fas fa-times" onClick={closeForm}></div>

      <form action="/login">
        <h3>Sign In</h3>

        <span>Username</span>
        <input type="email" name="email" className="box" placeholder="Enter your email" />

        <span>Password</span>
        <input type="password" name="password" className="box" placeholder="Enter your password" />

        <div className="checkbox">
          <input type="checkbox" name="remember" id="remember-me" />
          <label htmlFor="remember-me">Remember me</label>
        </div>

        <input type="submit" value="Sign in" className="btn" />

        <p>Forgot password? <a href="#">Click here</a></p>
        <p>Don't have an account? <a href="#" onClick={(e) => { e.preventDefault(); onShowRegister(); }}>Create one</a></p>
      </form>
    </div>
  );
}

export default LoginForm;
